import React from "react";

const EvaluationResults = ({ results }) => {
  return (
    <div>
      <h2>Değerlendirme Sonuçları</h2>
      <ul>
        {results.map((result, index) => (
          <li key={index}>
            {result.name} - Skor: {result.score}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default EvaluationResults;
